import React, { Component } from "react";

class ToDoHeader extends Component<props> {
  onAddToDo = () => {
    console.log("check1");
    // this.props.onAdd("test todo");
  };

  render() {
    return (
      <div>
        <button
          onClick={() => {
            this.props.onAdd("test todo");
          }}
        >
          Add Todo
        </button>
      </div>
    );
  }
}

export default ToDoHeader;
